import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import "./Login.css";

const SellerSignUpPage = () => {
  const navigate = useNavigate();

  const [formData, setFormData] = useState({
    firstName: "",
    lastName: "",
    orgName: "",
    businessNumber: "",
    businessEmail: "",
    password: "",
  });

  const [showPassword, setShowPassword] = useState(false);
  const togglePassword = () => setShowPassword(!showPassword);

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log("Seller Sign Up Data:", formData);
    alert("Seller account created successfully!");
  };

  return (
    <div className="login-container">
      <div className="login-card">
        <div className="login-header">
          <h2 className="logo-text">LiftOff</h2>
        </div>

        <form className="login-form" onSubmit={handleSubmit} noValidate>
          {/* First Name */}
          <div className="form-group">
            <div className="neu-input">
              <input
                type="text"
                name="firstName"
                placeholder=" "
                value={formData.firstName}
                onChange={handleChange}
                required
              />
              <label>First Name</label>
            </div>
          </div>

          {/* Last Name */}
          <div className="form-group">
            <div className="neu-input">
              <input
                type="text"
                name="lastName"
                placeholder=" "
                value={formData.lastName}
                onChange={handleChange}
                required
              />
              <label>Last Name</label>
            </div>
          </div>

          {/* Organization Name */}
          <div className="form-group">
            <div className="neu-input">
              <input
                type="text"
                name="orgName"
                placeholder=" "
                value={formData.orgName}
                onChange={handleChange}
                required
              />
              <label>Organization Name</label>
            </div>
          </div>

          {/* Business Number */}
          <div className="form-group">
            <div className="neu-input">
              <input
                type="text"
                name="businessNumber"
                placeholder=" "
                value={formData.businessNumber}
                onChange={handleChange}
                required
              />
              <label>Business Number</label>
            </div>
          </div>

          {/* Business Email */}
          <div className="form-group">
            <div className="neu-input">
              <input
                type="email"
                name="businessEmail"
                placeholder=" "
                value={formData.businessEmail}
                onChange={handleChange}
                required
              />
              <label>Business Email</label>
            </div>
          </div>

          {/* Password */}
          <div className="form-group">
            <div className="neu-input password-group">
              <input
                type={showPassword ? "text" : "password"}
                name="password"
                placeholder=" "
                value={formData.password}
                onChange={handleChange}
                required
              />
              <label>Password</label>

              <button
                type="button"
                className={`neu-toggle ${showPassword ? "show-password" : ""}`}
                onClick={togglePassword}
                aria-label="Toggle password visibility"
              >
                <svg className="eye-open" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2">
                  <path d="M1 12s4-8 11-8 11 8 11 8-4 8-11 8-11-8-11-8z" />
                  <circle cx="12" cy="12" r="3" />
                </svg>
                <svg className="eye-closed" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2">
                  <path d="M17.94 17.94A10.07 10.07 0 0 1 12 20c-7 0-11-8-11-8a18.45 18.45 0 0 1 5.06-5.94M9.9 4.24A9.12 9.12 0 0 1 12 4c7 0 11 8 11 8a18.5 18.5 0 0 1-2.16 3.19m-6.72-1.07a3 3 0 1 1-4.24-4.24" />
                  <line x1="1" y1="1" x2="23" y2="23" />
                </svg>
              </button>
            </div>
          </div>

          {/* Submit */}
          <button type="submit" className="neu-button signup-btn">
            <span className="btn-text">Sign Up as Seller</span>
          </button>
        </form>

        {/* Go Back */}
        <div className="signup-link" style={{ textAlign: "center", marginTop: "20px" }}>
          <p>
            Want to sign up as a buyer?{" "}
            <button
              type="button"
              className="neu-button login-btn"
              style={{
                width: "auto",
                padding: "10px 20px",
                fontSize: "14px",
                background: "#e0e5ec",
              }}
              onClick={() => navigate("/signup-buyer")}
            >
              Go to Buyer Sign Up
            </button>
          </p>
        </div>
      </div>
    </div>
  );
};

export default SellerSignUpPage;
